import React from 'react'
import { Link } from 'react-router-dom';
import styled from 'styled-components'

const HeaderStyled = styled.header`
    background-color: pink;
    display: flex;
    flex-flow: row nowrap;
    justify-content: space-between;
    align-items: center;
    margin: 0 auto;
    width: 100%;
    max-width: 1620px;

    h1 {
        font-size: 1.5rem;
        font-weight: 800;
    }
    h1 span:nth-child(1) {
        color: orange;
    }
    nav ul{
        display: flex;
        flex-flow: row nowrap;
        justify-content: space-between;
        align-items: center;
    }
    nav ul li {
        list-style: none;
    }
`;

function Header() {
    return (
        <HeaderStyled>
            <h1>
                <span>YUMMY</span>
                <span>APP</span>
            </h1>

            <nav>
                <ul>
                    <li>
                        <Link to="#">Login</Link>
                    </li>
                    <li>
                        <Link to="#">Sign In</Link>
                    </li>
                    <li>
                        <Link to="#">Submit Recipes</Link>
                    </li>
                </ul>
            </nav>
        </HeaderStyled>
    )
}

export default Header
